import CssBaseline from '@mui/material/CssBaseline';
import Box from '@mui/material/Box';
import Container from '@mui/material/Container';
import * as React from 'react';
import { useState } from 'react';
import useFormControl from '@mui/material';


//import FormInputs from './component/FormInputs';
import {
Select,
  Button,
  TextField,
 FormControl,
Checkbox,
  InputLabel,
  MenuItem,
  FormControlLabel,
  Avatar


} from "@mui/material";
//import { textAlign } from '@mui/system';

function App() {

  const loanData = {
    bankName:'',
    outstandingAmount:'',
    interestRate:'',
    interestType: '',
    loanType:'',
    term:'',
    properties : '',
    additionalSecurities: '',
    isCoborrowed: ''
  }

  const [inputField, setInputField] = useState(loanData);
  const [coborrow, setCoborrow] = useState({ isChecked: false, radio: "" });



  const handleChange = (e) => {
    let newField = { ...inputField };
    newField[e.target.name] = e.target.value;
    setInputField(newField);

    console.log(e.target.name + ":" + e.target.value);
  };

  const handleSubmit = (e) =>{
    e.preventDefault();
    //console.log(e.target.name + ":" + e.target.value);



  }


  const handleCheckBox = (e) => {
     console.log(e.target.value);
    setCoborrow({ ...coborrow, isChecked: !coborrow.isChecked });
  };

  return (<>


<React.Fragment>
      <CssBaseline />

      <Container maxWidth="md">
        <Box sx={{
          display: "flex",
          marginTop: 5,
          boxShadow: 5,
          borderRadius: 2,
          width: 800,
          justifyContent: "center",
          marginBottom :5,
          fontfamily: 'Poppins',
            fontweight: 400,

        }}>
         <FormControl>


         <FormControl sx={{

          display: "flex", 
          flexDirection: 'row'          
          }}>

            <h2>Loan Details</h2>

              <img src='https://www.google.com/imgres?imgurl=https%3A%2F%2Fmedia-exp1.licdn.com%2Fdms%2Fimage%2FC4D0BAQEqzjJtET4o5Q%2Fcompany-logo_200_200%2F0%2F1637751247947%3Fe%3D2147483647%26v%3Dbeta%26t%3Daub47FBWaZGX1IinM36QBg43YE8GQ5tKwoNSKJP2Zng&imgrefurl=https%3A%2F%2Fno.linkedin.com%2Fcompany%2Fclinsj&tbnid=G00WvOdwMv3ZfM&vet=12ahUKEwik5uSgjpv6AhUxT3wKHQL-Dw0QMygDegQIARAo..i&docid=8YuL1xyXuKjfYM&w=200&h=200&q=clinsj%20com&ved=2ahUKEwik5uSgjpv6AhUxT3wKHQL-Dw0QMygDegQIARAo'></img>


          </FormControl>
          <div>

      <FormControl sx={{ m: 2, minWidth: 400 }}>
        <InputLabel id="simple-select-autowidth-label" name="bankName">Bank Name</InputLabel>
        <Select
          // labelId="simple-select-autowidth-label"
          // id="simple-select-autowidth"

          onChange={(e) => handleChange(e)}
          value ={inputField.bankName}
          label="BankName"
        >
          <MenuItem value="">
            <em>None</em>
          </MenuItem>
          <MenuItem value={1}>Bank One</MenuItem>
          <MenuItem value={2}>Bank Two</MenuItem>
          <MenuItem value={3}>Bank Three</MenuItem>
        </Select>
      </FormControl>
    </div>

    <FormControl sx={{ m: 2, minWidth: 400 }}>
      <TextField type="number" 
      id="outlined-basic"
       label="Outstanding Amount"
       variant="outlined"
       name='outstandingAmount'

       onClick={(e) => handleChange(e)}
       value={inputField.outstandingAmount}
       />
      </FormControl>

      <FormControl sx={{ m: 2, minWidth: 400 }}>
      <TextField type="number"
       id="outlined-basic" 
       label="Interest Rate " 
       variant="outlined" 
       onChange={(e) => handleChange(e)}
        name='interestRate'
        value={inputField.interestRate}
       />
      </FormControl>


     <FormControl  sx={{ m: 2, minWidth: 400 }}>
      <TextField id="outlined-basic"
       label="Interest Type"
        name= "interestType"
         variant="outlined"

         onChange={(e) => handleChange(e)}
         value ={inputField.interestType}
          />
      </FormControl>

    <FormControl sx={{ m: 2, minWidth: 400 }}>

      <TextField 
      id="outlined-basic" 
      label="Loan Type"
       variant="outlined"
       name='loanType'
       onChange={(e) => handleChange(e)}
       value = {inputField.loanType}
        />
      </FormControl>

    <FormControl sx={{ m: 2, minWidth: 400 }}>

        <TextField 
        id="outlined-basic" 
        label="Term" 
        variant="outlined" 
        name='term'
        onChange={(e) => handleChange(e)}
        value = {inputField.term}
        />
      </FormControl>


    <FormControl sx={{ m: 2, minWidth: 400 }}>

      <TextField
       id="outlined-basic"
        label="Properties" 
        variant="outlined"     
        name='properties'
        onChange={(e) => {handleChange(e)}}
        value = {inputField.properties}
        />
      </FormControl>

    <FormControl sx={{ m: 2, minWidth: 400 }}>

      <TextField 
      id="outlined-basic"
       label="Additional Securities"
       variant="outlined" 
       name='additionalSecurities'
       onChange={(e) => {handleChange(e)}}
       value = {inputField.additionalSecurities}
       />
      </FormControl>



      <FormControlLabel 
       sx={{ m: 2, minWidth: 400 }}
          value="isCoborrowed"
          control={<Checkbox />}
          label="is Coborrowed ?"
          labelPlacement="is Coborrowed ?"
          onChange={(e) => handleCheckBox(e)}

        />

      <Button  sx={{ m: 1, minWidth: 200,marginBottom :5, lineheight: 28
 }}variant="contained" onClick={handleSubmit}>SAVE</Button>
      </FormControl>

      </Box>
      </Container>

    </React.Fragment>

    </>
  )
}

export default App
